    "chesapeake-marshlands-national-wildlife-refuge-complex-comprehensive-conservation-plan",nt"isopen":
    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Chesapeake Marshlands NWR Complex for the next
    15 years. This plan outlines the Complex vision and purpose and describes how Chesapeake
    Marshlands NWR Complex will contribute to the overall mission of the Refuge System.
    The plan provides an introduction to the Complex, an overview of the CCP process,
    a description of Refuge resources, information on the management direction, and
    a summary of administration. Key planning issues include: expanding human population,
    potential effects of land acquisition, potential effects of habitat change, and
    potential effects on floral and fauna populations.",nt"license_title": "License
